import React, { Component } from 'react'
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import { Home } from './components/Home';
export class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <Routes>
          <Route path='/' component={<Home/>}/>
        </Routes>
      </BrowserRouter>
    )
  }
}

export default App
